	'113425','112129')
	--202202月签呈，剔除逾期，当月
	and customer_no not in ('116727','113439','105502','114576','114269','116721','119965','114945','120618','125613','124379','125247','125256','124025','124667','124621',
	'124370','125469','123599','124782')
	--202202月签呈，公司BBC客户，不算提成，每月
